import React, { useState } from 'react';
import '../../css/Doctor/dicum.css'

import SideNavbar from '../../components/Doctor/sidenavbar';
import TopNavigationBar from '../../components/Doctor/Navbar';

const Documents = () => {
  const [consentModalOpen, setConsentModalOpen] = useState(false);
  const [selectedDocument, setSelectedDocument] = useState(null);
  const [selectedHospital, setSelectedHospital] = useState(null);
  const [hospitalListModalOpen, setHospitalListModalOpen] = useState(false);
  const [doctorListModalOpen, setDoctorListModalOpen] = useState(false);
  const [modalPosition, setModalPosition] = useState({ top: 0, left: 0 });

  const documents = [
    { id: 1, name: 'Patient Information.pdf', size: '2 MB' },
    { id: 2, name: 'Medical History.docx', size: '500 KB' },
    { id: 3, name: 'Latest Scans.zip', size: '10 MB' },
  ];

  const hospitals = [
    { id: 1, name: 'Joseph Hospital', doctors: ['Dr. Smith', 'Dr. Johnson', 'Dr. Williams'] },
    { id: 2, name: 'Kaweri Hospital', doctors: ['Dr. Brown', 'Dr. Lee', 'Dr. Martinez'] },
    { id: 3, name: 'Sanjeevni Hospital', doctors: ['Dr. Anderson', 'Dr. Garcia', 'Dr. Robinson'] },
    // Add more hospitals as needed
  ];

  const handleview= (document) => {
    setSelectedDocument(document);
  };

  const handleAskConsent = (document, event) => {
    event.preventDefault();
    setSelectedDocument(document);
    setModalPosition({ top: event.clientY, left: event.clientX });
    setConsentModalOpen(true);
  };

  const handleHospitalSelection = (hospital) => {
    setSelectedHospital(hospital);
    setHospitalListModalOpen(false);
    setDoctorListModalOpen(true);
  };

  const handleDoctorSelection = (doctor) => {
    console.log(`Selected doctor: ${doctor}`);
    // Implement your logic for handling doctor selection
    setDoctorListModalOpen(false);
  };

  return (
    <div className='dashboard-container'>
      <TopNavigationBar/>
      <div className='dashboard-content'>
        <SideNavbar/>
        <div className='main-content'>
          <div className="documents">
            <h2>Documents</h2>
            <table>
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Size</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {documents.map((document) => (
                  <tr key={document.id}>
                    <td>{document.name}</td>
                    <td>{document.size}</td>
                    <td>
                      <button onClick={() => handleview(document)}>View</button>
                      <button onClick={(event) => handleAskConsent(document, event)}>Ask Consent</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
            {consentModalOpen && (
              <div className="consent-modal" style={{ top: modalPosition.top, left: modalPosition.left }}>
                <h3>Grant Access</h3>
                <p>You are requesting access to "{selectedDocument?.name}".</p>
                <button onClick={() => setConsentModalOpen(false)}>Cancel</button>
              </div>
            )}
            {hospitalListModalOpen && (
              <div className="hospital-list-modal" style={{ top: modalPosition.top, left: modalPosition.left }}>
                <h3>Select Hospital</h3>
                <ul>
                  {hospitals.map((hospital) => (
                    <li key={hospital.id}>
                      <button onClick={() => handleHospitalSelection(hospital)}>{hospital.name}</button>
                    </li>
                  ))}
                </ul>
              </div>
            )}
            {doctorListModalOpen && (
              <div className="doctor-list-modal" style={{ top: modalPosition.top, left: modalPosition.left }}>
                <h3>Select Doctor</h3>
                <ul>
                  {selectedHospital.doctors.map((doctor, index) => (
                    <li key={index}>
                      <button onClick={() => handleDoctorSelection(doctor)}>{doctor}</button>
                    </li>
                  ))}
                </ul>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Documents;
